According to media reports, as of the end of September last year, the overall debt of the photovoltaic industry was close to 3 trillion yuan;
The overall debt ratio of the energy storage industry was close to 3 trillion yuan;
Among the 121 listed photovoltaic companies, 39 companies had a total debt scale of more than 10 billion yuan;
Among the 169 listed energy storage companies, 51 energy storage companies had a total debt scale of more than 10 billion yuan. https://pbs.twimg.com/media/GkjCBzlWEAAuuqx.jpg
